 Sex in suburbia will never be the same!


 A sexual frenzy erupts when Digital Playground contract star Kayden Kross is appointed to oversee her neighborhood's Home Owner's Association. Members Anikka Albrite and Tommy Gunn use Kayden's kitchen for a quickie while Bibi Jones and Bill Bailey find a sexier way to pay their dues in the living room. Kayden gets in on the action when she has sexy neighbor Giovanni Francesco over for dinner and serves herself as dessert.


